function removeNestedForm(n,t,i){var r=$(n).parents(t);r.find(i).val("True");r.hide();r.find(":input[data-val=true]").each(function(){$(this).removeAttr("data-val")});resetValidation()}function addNestedForm(n,t,i,r,u){var f=$(t).length,e=new RegExp(i,"gi"),o=new RegExp("proximoIndice","gi");r=r.replace(e,f).replace(o,f);$(n).append(r);$(u.replace(e,f)).focus();resetValidation()}function resetValidation(){$("form").removeData("validator");$("form").removeData("unobtrusiveValidation");$.validator.unobtrusive.parse("form")}